(3, '<h3>Pr&eacute;sentation</h3>\r\n\r\n<p>Les pr&eacute;sentes conditions g&eacute;n&eacute;rales d&rsquo;utilisation (ci-apr&egrave;s les &laquo; CGU &raquo;) ont pour objet de d&eacute;finir les conditions d&#39;acc&egrave;s et d&#39;utilisation d&#39;Ecosystem (ci-apr&egrave;s le &laquo; Site &raquo;).</p>\r\n\r\n<p>Est d&eacute;fini comme Utilisateur du Site (ci-apr&egrave;s l&rsquo;&laquo; Utilisateur&raquo; ou les &laquo; Utilisateurs &raquo;) tout personne se connectant au Site.</p>\r\n\r\n<p>L&rsquo;utilisation du Site de mani&egrave;re occasionnelle ou r&eacute;guli&egrave;re par l&rsquo;Utilisateur est subordonn&eacute;e &agrave; l&rsquo;acceptation pleine et enti&egrave;re et au respect int&eacute;gral des clauses, droits et obligations d&eacute;coulant des pr&eacute;sentes CGU.</p>\r\n\r\n<p>Cette utilisation est strictement r&eacute;serv&eacute;e &agrave; l&rsquo;Utilisateur tel que d&eacute;fini dans les pr&eacute;sentes CGU. Ecosystem se r&eacute;serve le droit de modifier ou de mettre &agrave; jour &agrave; tout moment les pr&eacute;sentes CGU et sans accord pr&eacute;alable de l&rsquo;Utilisateur.</p>\r\n\r\n<p>L&rsquo;Utilisateur ne peut acc&eacute;der au Site s&rsquo;il n&rsquo;accepte pas les CGU.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>&nbsp;ACC&Egrave;S AU SITE</h3>\r\n\r\n<p>Le Site est accessible depuis tout appareil pouvant se connecter &agrave; Internet.</p>\r\n\r\n<p>Pour acc&eacute;der &agrave; la consultation des donn&eacute;es, l&rsquo;Utilisateur devra s&rsquo;&ecirc;tre pr&eacute;alablement inscrit sur la plateforme et avoir pris connaissance des pr&eacute;sentes CGU.</p>\r\n\r\n<p>L&rsquo;Utilisateur devra s&rsquo;authentifier au moyen de son identifiant et de son mot de passe personnels pour acc&eacute;der au contenu du site.</p>\r\n\r\n<p>L&rsquo;Utilisateur s&rsquo;engage &agrave; accomplir toutes les diligences n&eacute;cessaires &agrave; la bonne s&eacute;curit&eacute; de son compte, notamment &agrave; ne pas conserver ses informations sur un support ouvert quel qu&rsquo;il soit, et ne pas communiquer ses identifiants.</p>\r\n\r\n<p>Par cons&eacute;quent, Ecosystem ne peut &ecirc;tre tenue responsable de toute connexion ou tentative de connexion frauduleuse d&rsquo;un tiers au moyen des identifiants d&rsquo;un Utilisateur.</p>\r\n\r\n<p>Ecosystem est seulement tenue &agrave; une obligation de moyens concernant l&rsquo;accessibilit&eacute; au Site. Ecosystem n&#39;est en aucun cas responsable des &eacute;ventuelles interruptions et des cons&eacute;quences qui peuvent en d&eacute;couler pour l&#39;Utilisateur ou tout tiers.</p>\r\n\r\n<p>Ecosystem se r&eacute;serve le droit de suspendre, d&#39;interrompre ou de limiter, sans avis pr&eacute;alable, l&#39;acc&egrave;s &agrave; tout ou partie du Site, notamment pour des op&eacute;rations de maintenance et de mises &agrave; jour n&eacute;cessaires au bon fonctionnement du Site et des mat&eacute;riels aff&eacute;rents, ou pour toute autre raison, notamment technique.</p>\r\n\r\n<p>&nbsp;</p>\r\n');
